import React from "react";
import "../stylesheets/nav.css";

class Nav extends React.Component {

  constructor() {}

  render() {
    return (
      <div>
        <div className="floating-nav" onClick={this.toggleModal} />
        <div className="nav-modal" />
        <p className="floating-name">Campbell Oleson</p>
      </div>
    );
  }



}

export default Nav;
